import React from 'react'
import {
    AppBar, Toolbar, ListItem, IconButton, ListItemText, 
    Avatar, Divider, List, Typography, Box
} from "@material-ui/core";
import {
    ArrowBack, AssignmentInd, Home, Apps, ContactMail
} from "@material-ui/icons";
import avatar from "../profilePhoto.jpg";
import { makeStyles } from '@material-ui/core/styles';

//Css
const useStyles = makeStyles({
    menuSliderContainer: {
        width: 250,
        background: "#511",
        height: "30rem"
    }
});

const Navbar = () => {
    const classes = useStyles()
    return (
        <>
        <Box className={classes.menuSliderContainer} component="div">
            <Avatar src={avatar} alt="Deepika Sathianarayanan"/>

        </Box>
        <Box component="nav">
            <AppBar position="static" style={{background: "#222"}}>
                <Toolbar>
                    <IconButton>
                        <ArrowBack style={{color: "tomato"}}/>
                    </IconButton>
                    <Typography variant="h5" style={{color: "tan"}}>
                        Portfolio
                    </Typography>
                </Toolbar>
            </AppBar>
        </Box>
        </>
    )
}

export default Navbar
